#returns Log signature of path p, which should be a numpy array of dimension [n,2] where n>=2, up to level m
def getLogSigOfPath(p,m):
	logsig=getLogSigObject(2,m)()
	logsig.sigarray[0:2]=p[1,:]-p[0,:]
	for i in range(2,p.shape[0]):
		logsig.joinSegment(p[i,:]-p[i-1,:])
	return logsig.sigarray
